// Login.js
import React from "react";
import { useNavigate } from "react-router-dom";
import './Login.css'
import bagImg from '../img/bag6.jpg'

const Login = () => {
  const navigate = useNavigate();
  const handleLogin = () => {
    // Add your login logic here
    const username = document.getElementById("username").value;
    const password = document.getElementById("password").value;

    // Example login validation
    if (username === "admin@admin.com" && password === "admin123") {
      // Successful login logic here
      alert("Login successful!");
      navigate("/Dashboard"); // Navigate to dashboard after successful login
    } else {
      // Failed login logic here
      alert("Invalid username or password");
    }
  };

  return (
    <section>
      <div className="leaves"></div>
      <img src={bagImg} className="bg" alt="" />

      <div className="login">
        <h2>Sign In</h2>
        <p>
          Login to <span className="name">InnoSmartSolutions</span>
        </p>
        <div className="inputBox">
          <input id="username" type="text" placeholder="Username" />
        </div>
        <div className="inputBox">
          <input id="password" type="password" placeholder="Password" />
        </div>
        <div className="inputBox">
          <input type="submit" value="Login" id="btn" onClick={handleLogin} />
        </div>
      </div>
    </section>
  );
};

export default Login;
